import React from "react";
import { Link } from "react-router-dom";
function Navbar() {
  return (
    <div>
      <h1>ATT KS</h1>
      <nav>
        <ul>
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="/ask">Ask Question</a>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Navbar;
